import Header from "./component/Header";
import { useState } from "react"


const [tittle, setitlle] =  useState('uhuy')
const angka = 22
const clickme = (nn) => {console.log('clicked' + nn)}


function App() {
  return (
    <div>
       <Header/>

       <h2>{tittle}</h2>
       <button ></button>
       <h2>{angka*7}</h2>
          <button onClick={ clickme } >click me</button>

    </div>
  );
}

export default App;
